.wrapper {
  margin-bottom: var(--mantine-spacing-5xl);
  padding: 0;
  text-align: center;
}

.imageWrapper {
  position: relative;
  margin: auto auto var(--mantine-spacing-lg);
  width: 200px;
  height: 200px;
  background-size: 200px;

  @mixin get-type-image;

  @mixin larger-than 992px {
    width: 300px;
    height: 300px;
    background-size: 300px;
  }
}

.image {
  position: relative;
  z-index: 1;
  margin: auto;
  border-radius: 50%;
  width: 200px;
  height: 200px;

  @mixin larger-than 992px {
    width: 300px;
    height: 300px;
  }
}

.title {
  margin-bottom: var(--mantine-spacing-sm);
  font-size: 22px;

  @mixin larger-than 992px {
    font-size: 28px;
  }
}

.text {
  @mixin larger-than 992px {
    font-size: 22px;
  }
}

